import Typewriter from 'typewriter-effect';

export default function Landing() {
    return (
        <div className="auth-parent">
            <div className="panel">
                <div className="paneltext">
                <Typewriter 
                      onInit={(typewriter) => {
                          typewriter.typeString("hello").typeString("me")
                      }}
                      options={{
                          autoStart: true,
                      }}
                    />
                </div>
            </div>
        </div>
    )
}
